import React from 'react';

import Header from './Header/index';
import { styles } from 'ansi-colors';

export default function App() {
  return (
      <div style={styles.app}>
        <Header />
      </div>
  );
}

const style = {
  app: {
    backgroundColor: '#999',
  },
};
